INSERT INTO `anime` (`id`, `judul`, `judul_alternatif`, `rating`, `voter`, `status`, `total_episode`, `hari_tayang`, `foto`, `created_at`, `updated_at`, `deskripsi`) VALUES
(1, 'Detective Conan (TV)', 'detective-conan-tv-1996', NULL, NULL, 'ongoing', NULL, 'minggu', 'storage/files/2020/01/26/94193c76632c8734aa210d3e198f7217.jpg', NULL, NULL, 'Shinichi Kudo adalah seorang detektif SMU berumur tujuh belas tahun yang biasa disebut “Sherlock Holmes moderen.” Namun, suatu malam setelah kencan dengan kekasih masa kecilnya, Ran, Shinichi menyaksikan perdagangan ilegal dan, tertangkap basah oleh penjahat, tak sadarkan diri dan diberi obat yang seharusnya untuk membunuhnya. saat ia terbangun dan mendapati dirinya menyusut ke usia tujuh tahun. Dalam rangka untuk melacak orang-orang yang melakukan itu padanya, Shinichi menyembunyikan identitasnya dan tinggal bersama Ran, yang ayahnya kebetulan seorang detektif pas-pasan, dan dengan itu datang serangkaian pembunuhan dan misteri yang harus ia pecahkan.Credit Sub By: Warung fansub'),
(2, 'Sword Art Online S1', 'sword-art-online-s1-2012', NULL, NULL, 'ended', 25, 'sabtu', 'storage/files/2020/01/26/3fa6e44983c467b5ce03f58315e031c2.jpg', NULL, NULL, 'Di masa depan tepatnya pada tahun 2020, telah tercipta permainan daring dunia maya yang tak terpadai atau Virtual Reality Massive Multiplayer Online Role-Playing Game (VRMMORPG) yang dinamakan Sword Art Online, di mana para pemain berinteraksi layaknya di dunia nyata dengan bantuan tekhnologi bernama NerveGear. Ini adalah permainan hidup-mati di mana para pemain tidak dapat keluar dan harus menyelesaikan permainan tersebut. Jika mati di dalamnya, maka kematian sesungguhnya pun akan menghampiri mereka.'),
(3, 'Sword Art Online S2', 'sword-art-online-s2-2014', NULL, NULL, 'ended', 24, 'jumat', 'storage/files/2020/01/26/f166d26248a9e9b6fe8bf2f6875ff9d5.jpg', NULL, NULL, 'Setelah season 1 di tahun 2012 selesai, kemarin yang bertepatan tanggal 5 july 2014 season 2 dari Sword Art Online kembali di tayangkan dengan judul Sword Art Online II. Banyak karakter baru dan permasalahan yang timbul dalam season 2 ini. Season 2 ini diproduksi oleh A1-Pictures dengan mendapatkan 24 episode yang didalamnya terdapat 3 arc, yakni arc Gun gale online (GGO), arc Excalibur dan arc Mother\'s Rosario. Sebelumnya saya pernah mereview season pertama dari anime ini, kamu bisa baca di artikel Review anime Sword Art online \'Terjebak di dunia game mematikan\'. Sword Art online II ini setiap arc-nya memiliki peran utama yang berbeda beda, jadi tidak seperti di season 1 yang hanya menampilkan Kirito dan Asuna saja.'),
(4, 'Sword Art Online Alternative: Gun Gale Online', 'sword-art-online-alternative-gun-gale-online-2018', NULL, NULL, 'ended', 12, 'sabtu', 'storage/files/2020/01/26/9b1c20ab442c713af8a0bd0d80b9518b.jpg', NULL, NULL, 'Karen Kohiruimaki selalu merasa tidak pada tempatnya di dunia nyata. Karena tinggi badannya yang tidak normal, dia kesulitan untuk berteman dengan gadis-gadis lain seusianya. Semuanya berubah ketika dia mengenal VR dan Gun Gale Online. Di GGO, Karen bebas untuk memainkan avatar yang lucu Seperti yang ia impikan! Bisakah Karen membuat persahabatan dalam game MMO yang dipenuhi peluru ini ...? \r\n+ Episode special SAO Recap'),
(5, 'Sword Art Online S3', 'sword-art-online-s3-2018', NULL, NULL, 'ended', 24, 'sabtu', 'storage/files/2020/01/26/cb0692f502b651605fb674517b67e4bd.jpg', NULL, NULL, 'Saat Kirito terbangun, dia berada di kedalaman hutan luas yang dipenuhi dengan pepohonan menjulang tinggi. Ketika dalam pencarian untuk menemukan petunjuk di sekitarnya, Kirito bertemu dengan seorang anak laki-laki yang tampaknya mengenal dirinya. Seharusnya anak itu adalah NPC biasa, akan tetapi ternyata dia mempunyai perasaan layaknya manusia. Saat mereka mencari orang tua dari anak itu, Kirito mulai mengingat kenangan-kenangan yang aneh. Kenangan dimasa kecilnya, tentang anak laki-laki, anak perempuan berambut emas, dan nama yang seharusnya tidak pernah dia lupakan, Alice.Info Kelanjutan-nya silahkan cek Ig  Nanime.in'),
(6, 'Sword Art Online: Alicization &#8211; War of Underworld', 'sword-art-online-alicization-8211-war-of-underworld-2019', NULL, NULL, 'ended', 12, 'sabtu', 'storage/files/2020/01/26/957c3757b565e306b425e01d331dae3b.jpg', NULL, NULL, 'Part Ke-2 Anime Sword Art Online: Alicization.'),
(7, 'Kuutei Dragons', 'kuutei-dragons-2020', NULL, NULL, 'ongoing', NULL, 'rabu', 'storage/files/2020/01/26/3dcf2678d5ce3d5844b7bf8955e7fb4c.jpg', NULL, NULL, 'Dragons, the rulers of the sky. To many people on the surface, they are a dire threat, but at the same time, a valuable source of medicine, oil, and food. There are those who hunt the dragons. They travel the skies in dragon-hunting airships. This is the story of one of those ships, the “Quin Zaza,” and its crew.(Source: Official site)'),
(8, 'Boruto: Naruto Next Generations', 'boruto-naruto-next-generations-2017', NULL, NULL, 'ongoing', NULL, 'selasa', 'storage/files/2020/01/26/e340a0f40f32c54fcbfd6fa07f78bd98.jpg', NULL, NULL, 'Setelah berakhirnya Perang Dunia Shinobi Keempat, Konohagakure menikmati masa damai, kemakmuran, dan kemajuan teknologi yang luar biasa. Ini semua karena upaya Pasukan Sekutu Shinobi dan Hokage Ketujuh desa, Naruto Uzumaki. Kini menyerupai kota metropolis modern, Konohagakure telah berubah, terutama kehidupan shinobi. Di bawah pengawasan ketat Naruto dan rekan-rekan lamanya, generasi baru shinobi telah melangkah untuk mempelajari cara ninja.Boruto Uzumaki sering menjadi pusat perhatian sebagai anak Hokage Ketujuh. Meskipun memiliki warisan Naruto riuh dan keras kepala, Boruto dianggap sebagai anak ajaib dan mampu melepaskan potensinya dengan bantuan teman dan keluarga yang mendukung. Sayangnya, ini hanya memperburuk arogansi dan keinginannya untuk melampaui Naruto yang, bersama dengan gaya hidup ayahnya yang sibuk, telah menegangkan hubungan mereka. Namun, kekuatan jahat yang berkembang di dalam desa dapat mengancam kehidupan Borobudur yang ceria. Teman baru dan wajah akrab bergabung dengan Boruto sebagai cerita baru dimulai di Boruto: Naruto Next Generations.');
