INSERT INTO `video` (`id`, `judul`, `tipe`, `episode`, `foto`, `deskripsi`, `server1`, `server2`, `server3`, `server4`, `jum_report`, `id_anime`, `created_at`, `updated_at`, `judul_alternatif`) VALUES
(1, ' Episode 968 Sub Indo', 'episode', 0, 'storage/files/2020/01/26/ac154ba8c184b6b3a6d21dc89a0c4191.jpg', 'Shinichi Kudo adalah seorang detektif SMU berumur tujuh belas tahun yang biasa disebut “Sherlock Holmes moderen.” Namun, suatu malam setelah kencan dengan kekasih masa kecilnya, Ran, Shinichi menyaksikan perdagangan ilegal dan, tertangkap basah oleh penjahat, tak sadarkan diri dan diberi obat yang seharusnya untuk membunuhnya. saat ia terbangun dan mendapati dirinya menyusut ke usia tujuh tahun. Dalam rangka untuk melacak orang-orang yang melakukan itu padanya, Shinichi menyembunyikan identitasnya dan tinggal bersama Ran, yang ayahnya kebetulan seorang detektif pas-pasan, dan dengan itu datang serangkaian pembunuhan dan misteri yang harus ia pecahkan.Credit Sub By: Warung fansub', 'https://uservideo.xyz/file/nanime.detective.conan.968.480p.mkv?embed=true&amp;autoplay=true', 'https://naniplay.nanime.in/file/nanime.detective.conan.968.480p.mkv?embed=true&amp;autoplay=true', 'https://naniplay.nanime.in/file/nanime.detective.conan.968.720p.mkv?embed=true&amp;autoplay=true', 'https://www.autoratio.com/sKjsMBi?embed=true&amp;autoplay=true', NULL, 1, NULL, NULL, 'episode-968-sub-indo'),
