(921, 'Detective Conan Movie 23: The Fist of Blue Sapphire Sub Indo', 'movie', 0, 'storage/files/2020/01/26/73639191427c44119959d0f7810f9cf0.jpg', 'Conan bepergian ke luar negeri yaitu ke Singapura di mana dia dan Kaitou Kid menjadi terlibat dalam konspirasi yang melibatkan pembunuhan di Marina Bay Sands dan Blue Sapphire yang misterius.', 'https://autoratio.com/KlRzyv?720p?embed=true&amp;autoplay=true', 'https://autoratio.com/mjQP1yeR7?embed=true&amp;autoplay=true', 'https://naniplay.nanime.in/file/nanime.detective.conan.movie.23.720p.mp4?embed=true&amp;autoplay=true', 'https://naniplay.nanime.in/file/nanime.detective.conan.movie.23.480p.mp4?embed=true&amp;autoplay=true', NULL, 1, NULL, NULL, 'detective-conan-movie-23-the-fist-of-blue-sapphire-sub-indo');
INSERT INTO `video` (`id`, `judul`, `tipe`, `episode`, `foto`, `deskripsi`, `server1`, `server2`, `server3`, `server4`, `jum_report`, `id_anime`, `created_at`, `updated_at`, `judul_alternatif`) VALUES
(922, 'Detective Conan Movie 22 Sub Indo', 'movie', 0, 'storage/files/2020/01/26/7f2cba68f313b0c1e57ef35710d2ea23.jpg', 'Detective Conan menyelidiki ledakan yang terjadi pada hari pembukaan sebuah resor dan pusat konvensi besar di Tokyo.', 'https://vidoza.net/embed-mg8r4e1qg7u4.html?1080p?embed=true&amp;autoplay=true', 'https://nanifile.com/plugins/mediaplayer/site/_embed.php?u=v4&w=640&h=320?embed=true&amp;autoplay=true', NULL, NULL, NULL, 1, NULL, NULL, 'detective-conan-movie-22-sub-indo'),
(923, 'Detective Conan Movie 21 Sub Indo', 'movie', 0, 'storage/files/2020/01/26/7eb2d6c81dc79b04fa83a38833e04b2f.jpg', 'Kasus pemboman di Nichiuri TV di musim gugur. Piala Satsuki, yang memahkotai pemenang Hyakunin Isshu Jepang, saat ini sedang difilmkan di dalam fasilitas. Insiden ini menyebabkan keributan besar dan, sementara bangunan terbakar menjadi abu, satu-satunya orang yang tersisa di dalam adalah Hattori dan Toyama Kazuha. Mereka diselamatkan tepat waktu oleh Conan, yang bergegas ke tempat kejadian. Identitas dan tujuan pelaku bom tidak diketahui. Sementara kebingungan mengambil alih karena ledakan, Conan bertemu dengan seorang gadis cantik misterius yang mengklaim dia adalah \"tunangan Heiji\". Namanya adalah Momiji Ooka dan dia adalah juara permainan karuta Kyoto High School. Seperti sudah ditakdirkan, Kazuha akan menghadapi Momiji di Hyakunin Isshu, jadi dia mulai berlatih dengan bantuan ibu Heiji, Shizuoka, yang merupakan pemain Karuta yang terampil. Pada saat yang sama, di sebuah rumah Jepang di pinggiran Arashiyama Kyoto, juara Piala Satsuki yang berkuasa terbunuh. Foto-foto tempat kejadian mengungkapkan kehadiran Momji. Selain itu, beberapa kartu Karuta tersebar di sekitar korban. Conan dan Heiji, bersama dengan departemen kepolisian Osaka dan Kyoto, memulai penyelidikan mereka pada Piala Satsuki dan kasus pembunuhan terkait. Saat penyelidikan berlangsung, mereka menemukan sebuah rahasia yang terhubung dengan Hyakunin Isshu.', 'https://vidoza.net/embed-65diqyjbnhtf.html?1080p?embed=true&amp;autoplay=true', 'https://nanifile.com/plugins/mediaplayer/site/_embed.php?u=v3&w=640&h=320?embed=true&amp;autoplay=true', NULL, NULL, NULL, 1, NULL, NULL, 'detective-conan-movie-21-sub-indo'),
(924, 'Detective Conan Movie 19 Sub Indo', 'movie', 0, 'storage/files/2020/01/26/49b8043683c456cd5bbe567f9c257ee0.jpg', 'Conan dan teman-temannya harus mencegah Kid mencuri lukisan terkenal.', 'https://vidoza.net/embed-1h73pa0zuhdi.html?1080p?embed=true&amp;autoplay=true', 'https://nanifile.com/plugins/mediaplayer/site/_embed.php?u=L6&w=640&h=320?embed=true&amp;autoplay=true', NULL, NULL, NULL, 1, NULL, NULL, 'detective-conan-movie-19-sub-indo'),
(925, 'Detective Conan Movie 17 Sub Indo', 'movie', 0, 'storage/files/2020/01/26/81afa8445f82987dfddf14339d4f1dd1.jpg', 'Conan dan teman-temannya mencari mata-mata asing yang mungkin juga melakukan pembunuhan.', 'https://vidoza.net/embed-2hadohgzbi7j.html?720p?embed=true&amp;autoplay=true', 'https://vidoza.net/embed-vos6485tch84.html?360p?embed=true&amp;autoplay=true', 'https://vidoza.net/embed-hw0bxn73hwl5.html?480p?embed=true&amp;autoplay=true', 'https://vidoza.net/embed-antxsy19g0yy.html?1080p?embed=true&amp;autoplay=true', NULL, 1, NULL, NULL, 'detective-conan-movie-17-sub-indo'),
(926, 'Detective Conan Movie 20 Sub Indo', 'movie', 0, 'storage/files/2020/01/26/bb9075eb1f8f3ad7165d5251d618f48b.jpg', 'Seorang mata-mata menyusup ke Badan Kepolisian Nasional Jepang, mengambil file rahasia MI6 Inggris, BND Jerman dan CIA Amerika dan FBI. Rei Furuya dan sekelompok PSB Kepolisian Tokyo mencegat mata-mata itu selama liburan, dan tepat sebelum kecelakaan mobil besar, Agen FBI Shuichi Akai menembak dan menabrak kendaraan mata-mata. Keesokan harinya, di akuarium di Tokyo dengan roda Ferris, Conan dan Detective Boys menemukan seorang wanita dengan heterochromia iris yang menderita kehilangan ingatan dan memiliki ponsel yang rusak. Setelah memutuskan untuk tinggal dan membantu wanita itu mendapatkan kembali ingatannya, Conan dan Detective Boys berada di bawah pengawasan ketat Vermouth.', 'https://vidoza.net/embed-exag3kmo4zrj.html?1080p?embed=true&amp;autoplay=true', 'https://nanifile.com/plugins/mediaplayer/site/_embed.php?u=v2&w=640&h=320?embed=true&amp;autoplay=true', NULL, NULL, NULL, 1, NULL, NULL, 'detective-conan-movie-20-sub-indo'),
(927, 'Detective Conan Movie 12 Sub Indo', 'movie', 0, 'storage/files/2020/01/26/b9fdf6eef16607389786651326237adc.jpg', '6 tahun yang lalu ada seorang pemuda berbakat yang terbunuh. tunangannya Reiko Akiba sekarang menjadi Soprano yang sangat populer. orang-orang yang membunuh tunangan Reiko semuanya terbunuh pada titik \"Pitch Sempurna Pasti\" (Jor-Dai-Yin-Gan) dari ayah sejati pemuda ini, Fuwa, adjuster pitch piano Domoto Kazuki. Domoto Academy membeli Viola Stradivalous baru dan tampil di pembukaan Domoto Hall. Tetapi Fuwa telah memasang 24 bom di dalam Domoto Hall. Sebelum mereka meledak, Reiko Akiba dan Conan harus menghentikan bom 24 Fuwa yang menghancurkan semua fasilitas dan membunuh semua orang di dalam Domoto Hall. BTW, akhirnya, Rachel berbicara bahwa ketika Kudo bermain Guitar ada kebiasaan yang sangat aneh dari Kudo sehingga dia dapat dengan mudah mengetahui bahwa itu pasti Shinichi.', 'https://vidoza.net/embed-k20cdgu727wz.html?1080p?embed=true&amp;autoplay=true', 'https://nanifile.com/plugins/mediaplayer/site/_embed.php?u=ua&w=640&h=320?embed=true&amp;autoplay=true', NULL, NULL, NULL, 1, NULL, NULL, 'detective-conan-movie-12-sub-indo'),
(928, 'Detective Conan Movie 10 Sub Indo', 'movie', 0, 'storage/files/2020/01/26/be8e3d523081dac009246f447a5dc82b.jpg', 'Pada 4 April 2006 Ito Suehiko &amp; Shimizu Reiko merampok truk uang tunai bersama Nishio Masara. Pada 6 April 2006 Shimizu Reiko membunuh Nishio di perusahaan mereka. Pada 15 Mei 2006 Shimizu Reiko dinyatakan bunuh diri dan meninggal. (SEKARANG) Mori Kogoro mengantarkan Ran dan Conan dan yang lainnya ke Miracleland. Ketika Ran memerintahkan Conan untuk pergi bersama-sama, Klien menghentikan Conan meninggalkan kantor! Apa yang terjadi? \"Pada 22:00 Anda harus menyelesaikan ini, atau yang lain, semua sabuk ID Anda akan meledak\" Ketika polisi Kanagawa berbicara pada tanggal 4 April, Conan mendapat telepon, \"Detektif Mori? Tidak! Apakah Anda Kudo? Benar-benar Anda! Tinggi - Detektif Pelajar Sekolah Kudo Shinichi. \" Apa yang akan terjadi pada semua orang pada jam 10 malam?', 'https://vidoza.net/embed-iu17xf6wicwm.html?720p?embed=true&amp;autoplay=true', 'https://nanifile.com/plugins/mediaplayer/site/_embed.php?u=u0&w=640&h=320?embed=true&amp;autoplay=true', NULL, NULL, NULL, 1, NULL, NULL, 'detective-conan-movie-10-sub-indo'),
(929, 'Detective Conan Movie 09 Sub Indo', 'movie', 0, 'storage/files/2020/01/26/2b8ec94bf14d93209e3ddcd78327da25.jpg', 'Sebuah kapal milik kelompok Yatsushiro menabrak gunung es dan tenggelam. Lima belas tahun kemudian, kelompok Yatsushiro mengundang Detektif Kogoro dan teman-temannya di kapal pesiar tempat terjadinya pembunuhan. Sekarang Conan dan polisi berusaha mengidentifikasi si pembunuh.', 'https://vidoza.net/embed-s8cktdh8dai8.html?1080p?embed=true&amp;autoplay=true', 'https://vidoza.net/embed-p71k63lcgzkx.html?720p?embed=true&amp;autoplay=true', 'https://vidoza.net/embed-725y2tzbwzsy.html?embed=true&amp;autoplay=true', 'https://nanifile.com/plugins/mediaplayer/site/_embed.php?u=u3&w=640&h=320?embed=true&amp;autoplay=true', NULL, 1, NULL, NULL, 'detective-conan-movie-09-sub-indo'),
(930, 'Detective Conan Movie 07 Sub Indo', 'movie', 0, 'storage/files/2020/01/26/b8a16425200b9672507d6fb4d62029b5.jpg', '5 orang terbunuh oleh pedang dan dan juga patung Buddha yang penting dirampok, jadi Conan mencoba mencari pembunuh dan patung itu.', 'https://vidoza.net/embed-qv7q75856dkf.html?720p?embed=true&amp;autoplay=true', 'https://nanifile.com/plugins/mediaplayer/site/_embed.php?u=u1&w=640&h=320?embed=true&amp;autoplay=true', NULL, NULL, NULL, 1, NULL, NULL, 'detective-conan-movie-07-sub-indo'),
(931, 'Detective Conan Movie 06 Sub Indo', 'movie', 0, 'storage/files/2020/01/26/ce526ec7930785362ec1e638c6d998e8.jpg', 'Conan dan teman-temannya diundang ke premier game komputer virtual baru. Tetapi seseorang memprogram permainan, bahwa jika mereka tidak dapat menjawab teka-teki dalam permainan, mereka semua harus mati.', 'https://vidoza.net/embed-lcw2pw97urud.html?720p?embed=true&amp;autoplay=true', 'https://vidoza.net/embed-7jlr2vyswufs.html?1080p?embed=true&amp;autoplay=true', 'https://nanifile.com/plugins/mediaplayer/site/_embed.php?u=K5&w=640&h=320?embed=true&amp;autoplay=true', 'https://nanifile.com/plugins/mediaplayer/site/_embed.php?u=uy&w=640&h=320?embed=true&amp;autoplay=true', NULL, 1, NULL, NULL, 'detective-conan-movie-06-sub-indo'),
(932, 'Detective Conan Movie 05 Sub Indo', 'movie', 0, 'storage/files/2020/01/26/85c61085cf1fd1dcceaa2a8eb8dfc7e3.jpg', 'Gin dan Vodka menyelinap ke rumah Akemi Miyano dan mendengar pesan Shiho bahwa dia akan mengunjungi Menara Kembar Tokiwa. Apakah Shiho akan terbunuh?', 'https://vidoza.net/embed-6n6hycfh2k2r.html?1080p?embed=true&amp;autoplay=true', 'https://nanifile.com/plugins/mediaplayer/site/_embed.php?u=K3&w=640&h=320?embed=true&amp;autoplay=true', NULL, NULL, NULL, 1, NULL, NULL, 'detective-conan-movie-05-sub-indo'),
(933, 'Detective Conan Movie 03 Sub Indo', 'movie', 0, 'storage/files/2020/01/26/221654170a93b5fec4596722fcc42c35.jpg', 'Kaitou Kid berani menantang polisi sekali lagi, mengarahkan pandangannya pada Telur Paskah Kekaisaran Rusia. Dengan tanggal, waktu, dan tempat, kepolisian Osaka berebut untuk menghentikannya. Tapi kali ini, Kid mungkin telah menggigit lebih banyak daripada yang bisa dia kunyah — Conan Edogawa, Heiji Hattori, dan banyak lainnya juga berusaha mendapatkan telur permata itu. Ketika perlombaan untuk memiliki telur meningkat, serangkaian pembunuhan mengancam mereka setelahnya, dan pada saat yang sama kebenaran tragis di balik Dinasti Romanov akhirnya terungkap. Di pusat perkembangan ini, tergantung pada Conan untuk menyelesaikan pembunuhan mengerikan dan menangkap Kid, semuanya sambil melindungi mereka yang dekat dengannya dan menyembunyikan identitasnya.', 'https://vidoza.net/embed-1is5fx5ikmub.html?720p?embed=true&amp;autoplay=true', 'https://nanifile.com/plugins/mediaplayer/site/_embed.php?u=K1&w=640&h=320?embed=true&amp;autoplay=true', NULL, NULL, NULL, 1, NULL, NULL, 'detective-conan-movie-03-sub-indo'),
(934, 'Detective Conan Movie 02 Sub Indo', 'movie', 0, 'storage/files/2020/01/26/56ce51b8ef39b8a5191865923a20561b.jpg', 'Orang-orang yang dikaitkan dengan Mori Kogoro diserang atau dibunuh berdasarkan urutan nomor nama mereka.', 'https://vidoza.net/embed-g9dm904d3r5q.html?1080p?embed=true&amp;autoplay=true', 'https://nanifile.com/plugins/mediaplayer/site/_embed.php?u=K0&w=640&h=320?embed=true&amp;autoplay=true', NULL, NULL, NULL, 1, NULL, NULL, 'detective-conan-movie-02-sub-indo'),
(935, 'Detective Conan Movie 18 Sub Indo', 'movie', 0, 'storage/files/2020/01/26/fca4129b8222b71b8bacf978e71dfe76.jpg', 'Seorang penembak jitu telah muncul di Tokyo, membuat orang-orang terlalu takut untuk pergi keluar, sekali lagi terserah kepada Conan untuk mencari tahu arti dibalik pembunuhan dan menangkap sniper misterius sebelum lebih banyak nyawa hilang.', 'https://vidoza.net/embed-7kr2x28wqsbd.html?720p?embed=true&amp;autoplay=true', 'https://nanifile.com/plugins/mediaplayer/site/_embed.php?u=v1&w=640&h=320?embed=true&amp;autoplay=true', NULL, NULL, NULL, 1, NULL, NULL, 'detective-conan-movie-18-sub-indo'),
(936, 'Detective Conan Movie 16 Sub Indo', 'movie', 0, 'storage/files/2020/01/26/213ac86cc40d667b0565db40e54d44d3.jpg', 'Detective Boys menghadiri acara promosi di mana J. League bermain sepak bola dengan anak-anak di mana kelompok ini berkenalan dengan orang-orang di sana. Keesokan harinya, Detective Boys menonton pertandingan sepak bola di Stadion Touto. Kogoro Mori menerima panggilan telepon dari pembom yang memasok lokasi bom dalam bentuk teka-teki. Teka-teki itu berbunyi \"Zebra biru dan bocah biru, hujan dari atas, orang-orang dari bawah, tangan kiri mereka, seperti yang terlihat, pohon di sebelah kiri. Ran Mori menyampaikan teka-teki itu kepada Shinichi Kudo yang memungkinkan Conan menguraikannya. Zebra biru dan anak laki-laki merujuk pada maskot tim yang saat ini bermain di stadion Touto. Sisa teka-teki itu adalah permainan kanji; Bagian atas Rain (?), bagian bawah People (?), sebelah kiri Hand (?), Perlihatkan (?) Apa adanya, dan di sebelah kiri Tree (?). Mengisi bagian-bagian kanji yang hilang dan menambahkannya bersama-sama agar membentuk kata Papan Skor Elektronik (?). Dengan sedikit waktu untuk mengevakuasi para penonton, Conan melintasi membangun infrastruktur dan mengatur bahan peledak sehingga papan skor berlawanan arah dengan orang-orang.', 'https://vidoza.net/embed-m0p2949w975w.html?720p?embed=true&amp;autoplay=true', 'https://nanifile.com/plugins/mediaplayer/site/_embed.php?u=L7&w=640&h=320?embed=true&amp;autoplay=true', NULL, NULL, NULL, 1, NULL, NULL, 'detective-conan-movie-16-sub-indo'),
(937, 'Detective Conan Movie 14 Sub Indo', 'movie', 0, 'storage/files/2020/01/26/a9a22a355dacc1e1b5077462047ec4c5.jpg', 'Kid memiliki mata tertuju pada permata \"Lady of the Sky\" di atas Bell 3, pesawat terbesar di dunia. Namun, kelompok teroris misterius bernama Red Shamu-neko telah membajak pesawat, bersama dengan Conan dan sekutunya Kogoro dan Ran.', 'https://vidoza.net/hn3m5wac2wyh.html?embed=true&amp;autoplay=true', 'https://vidoza.net/embed-zu8bihzypczm.html?720p?embed=true&amp;autoplay=true', 'https://nanifile.com/plugins/mediaplayer/site/_embed.php?u=u8&w=640&h=320?embed=true&amp;autoplay=true', NULL, NULL, 1, NULL, NULL, 'detective-conan-movie-14-sub-indo'),
(938, 'Detective Conan Movie 13 Sub Indo', 'movie', 0, 'storage/files/2020/01/26/e276f6717006e16ef6a84c337cd4dad5.jpg', 'Pengawas polisi, yang disamarkan oleh jas hitam (IRish), memeriksa apakah Conan dan Shinichi sama 98%! Conan sedang dalam bahaya ...! Apakah pengawas polisi itu akan memberi tahu Gin tentang berita ini? Rachel memecahkan mangkuk Conan! Keesokan harinya ketika Rachel pergi ke sekolah, Serena berbicara tentang helm ksatria gelap ... Conan pergi ke sekolah untuk mendengar bahwa lumba-lumba tanah liatnya kehilangan sirip punggungnya ... Apakah Conan dapat tetap hidup seperti harapan Heiji di dalam telepon ketika berbicara tentang \"BBQ di Kyoto\"?', 'https://vidoza.net/embed-gs26nfq36g2f.html?1080p?embed=true&amp;autoplay=true', 'https://nanifile.com/plugins/mediaplayer/site/_embed.php?u=u9&w=640&h=320?embed=true&amp;autoplay=true', NULL, NULL, NULL, 1, NULL, NULL, 'detective-conan-movie-13-sub-indo'),
(939, 'Detective Conan Movie 11 Sub Indo', 'movie', 0, 'storage/files/2020/01/26/0823693a7911f80653a8d1426256aaa2.jpg', '1700 kali, Anne Bonny dan Mary Read adalah 2 perompak perempuan yang melindungi negara mereka dari serangan dari Inggris. Orang yang berlayar ke laut semua takut JOLLY ROGER yang dibentuk oleh bendera merah Jolly Rouge &amp; setan OLD ROGER. Sekarang 2007. Conan menang dalam teka-teki lembaran dan Mori menggunakan uang itu untuk berlibur di pulau Koumi bersama anak-anak dan Ran. Iwagana, pemandu wisata Koumi, ingin memanfaatkan kebijaksanaan turis untuk menemukan 1700 harta karun Anne Bonny. Apa harta berharga yang disimpan Anne Bonny di dalam Yoriyajima sejak 1700 kali ketika dia bekerja dengan Mary Read?', 'https://vidoza.net/embed-qtwku3s0k1ch.html?720p?embed=true&amp;autoplay=true', 'https://nanifile.com/plugins/mediaplayer/site/_embed.php?u=u7&w=640&h=320?embed=true&amp;autoplay=true', NULL, NULL, NULL, 1, NULL, NULL, 'detective-conan-movie-11-sub-indo'),
(940, 'Detective Conan Movie 08 Sub Indo', 'movie', 0, 'storage/files/2020/01/26/705ea24da0080cb527bb83706e259b8f.jpg', 'Juri Maki, aktris opera terkenal, mendapat surat dari Kaido Kido di balkon dengan mawar. Juri dan asistennya menemukan Kogoro dan meminta Kogoro untuk menjaga Permata Takdirnya selama pertunjukan terakhir Josephine. Kaido Kido menyamar sebagai Kudo Shinichi tetapi pergi ketika pertunjukan baru saja diputar ke bagian tengah. Conan hampir jatuh dan Kaido Kido melarikan diri ketika mereka berdua berada di atas kereta. Di SKJ865, Juri tiba-tiba meninggal setelah makan cokelat. Siapa pembunuhnya dan untuk alasan apa?', 'https://vidoza.net/embed-gpzjcri8r3zu.html?1080p?embed=true&amp;autoplay=true', 'https://nanifile.com/plugins/mediaplayer/site/_embed.php?u=u2&w=640&h=320?embed=true&amp;autoplay=true', NULL, NULL, NULL, 1, NULL, NULL, 'detective-conan-movie-08-sub-indo'),
(941, 'Detective Conan Movie 04 Sub Indo', 'movie', 0, 'storage/files/2020/01/26/f8ba32144738b10626b49d0a1a7ea51b.jpg', '3 petugas polisi terbunuh. Lalu Ran melihat si pembunuh membunuh sahabatnya dan dia kehilangan ingatannya. Sekarang Conan dan Inspektur Megure berusaha menemukan pembunuhnya.', 'https://vidoza.net/embed-fpnm26fpo19t.html?720p?embed=true&amp;autoplay=true', 'https://nanifile.com/plugins/mediaplayer/site/_embed.php?u=K2&w=640&h=320?embed=true&amp;autoplay=true', NULL, NULL, NULL, 1, NULL, NULL, 'detective-conan-movie-04-sub-indo'),
(942, 'Detective Conan Movie 15 Sub Indo', 'movie', 0, 'storage/files/2020/01/26/21b724c8647ee5750a61c331b21768b6.jpg', 'Ledakan jalur kereta bawah tanah Tokyo yang baru membawa Conan dan teman-temannya di desa berpakaian salju. Di sini, setelah 8 tahun, detektif kecil itu menyoroti dinamika di balik peristiwa mengejutkan yang menyebabkan kematian seorang wanita dan koma seorang anak lelaki berusia 15 tahun. Di bawah salju yang indah, Conan terlibat dalam sesuatu yang lebih besar darinya.', 'https://vidoza.net/embed-8oh1bg0v3akt.html?1080p?embed=true&amp;autoplay=true', 'https://nanifile.com/plugins/mediaplayer/site/_embed.php?u=ub&w=640&h=320?embed=true&amp;autoplay=true', NULL, NULL, NULL, 1, NULL, NULL, 'detective-conan-movie-15-sub-indo'),
(943, 'Detective Conan Movie 01 Sub Indo', 'movie', 0, 'storage/files/2020/01/26/050ec5fd293e50d8e228166d54a4cd7f.jpg', 'Detektif genius Conan harus menyelesaikan serangkaian pemboman atau cinta sejatinya akan mati!', 'https://vidoza.net/embed-vfh663zh3n1e.html?1080p?embed=true&amp;autoplay=true', 'https://nanifile.com/plugins/mediaplayer/site/_embed.php?u=JY&w=640&h=320?embed=true&amp;autoplay=true', NULL, NULL, NULL, 1, NULL, NULL, 'detective-conan-movie-01-sub-indo'),
(944, ' Episode 13 Sub Indo', 'episode', 0, 'storage/files/2020/01/26/371c9b726e9be8c6019747984b197b05.jpg', 'Di masa depan tepatnya pada tahun 2020, telah tercipta permainan daring dunia maya yang tak terpadai atau Virtual Reality Massive Multiplayer Online Role-Playing Game (VRMMORPG) yang dinamakan Sword Art Online, di mana para pemain berinteraksi layaknya di dunia nyata dengan bantuan tekhnologi bernama NerveGear. Ini adalah permainan hidup-mati di mana para pemain tidak dapat keluar dan harus menyelesaikan permainan tersebut. Jika mati di dalamnya, maka kematian sesungguhnya pun akan menghampiri mereka.', 'https://uservideo.xyz/file/nanime.sword.art.online.s1.e13.sub.indo.480p.mp4?embed=true&amp;autoplay=true', 'https://naniplay.nanime.in/file/nanime.sword.art.online.s1.e13.sub.indo.720p.mp4?embed=true&amp;autoplay=true', 'https://naniplay.nanime.in/file/nanime.sword.art.online.s1.e13.sub.indo.480p.mp4?embed=true&amp;autoplay=true', NULL, NULL, 2, NULL, NULL, 'episode-13-sub-indo'),
(945, ' Episode 12 Sub Indo', 'episode', 0, 'storage/files/2020/01/26/590acb412ec28d9c8987cc5638510a98.jpg', 'Di masa depan tepatnya pada tahun 2020, telah tercipta permainan daring dunia maya yang tak terpadai atau Virtual Reality Massive Multiplayer Online Role-Playing Game (VRMMORPG) yang dinamakan Sword Art Online, di mana para pemain berinteraksi layaknya di dunia nyata dengan bantuan tekhnologi bernama NerveGear. Ini adalah permainan hidup-mati di mana para pemain tidak dapat keluar dan harus menyelesaikan permainan tersebut. Jika mati di dalamnya, maka kematian sesungguhnya pun akan menghampiri mereka.', 'https://uservideo.xyz/file/nanime.sword.art.online.s1.e12.sub.indo.480p.mp4?embed=true&amp;autoplay=true', 'https://naniplay.nanime.in/file/nanime.sword.art.online.s1.e12.sub.indo.720p.mp4?embed=true&amp;autoplay=true', 'https://naniplay.nanime.in/file/nanime.sword.art.online.s1.e12.sub.indo.480p.mp4?embed=true&amp;autoplay=true', NULL, NULL, 2, NULL, NULL, 'episode-12-sub-indo'),
(946, 'Sword Art Online Movie: Ordinal Scale Sub Indo', 'movie', 0, 'storage/files/2020/01/26/0548eac8d7aa26c200af7354b5b6cba9.jpg', 'Pada tahun 2022, dunia virtual reality dikejutkan dengan penemuan baru dari seorang programmer jenius, Kayaba Akihiko. NerveGear, merupakan sistem pertama yang dapat digunakan secara menyeluruh dengan kemungkinan tak terbatas untuk VRMMORPG. Tahun 2026, sebuah mesin baru bernama Augma dikembangkan untuk menyaingi NerveGear dan penerus dari Amusphere. Augma yang merupakan perangkat generasi terbaru tidak dilengkapi dengan fungsi full-dive seperti yang dimiliki pada perangkat-perangkat generasi sebelumnya. Akan tetapi Augma dilengkapi dengan fitur augmented reality yang memungkinkan pemainnya bisa masuk dalam permainan. Fitur ini sangatlah aman, mudah digunakan, dan memungkinkan pemain untuk bermain tanpa kehilangan kesadaran. Alhasil, popularitas Augma meledak di pasaran. Game paling populer yang menggunakan sistem Augma bernama Ordinal Scale (OS), sebuah ARMMORPG yang dikembangkan khusus untuk sistem augma. Asuna dan kawan-kawan sudah terlebih dahulu memainkan OS sebelum pada akhirnya Kirito ikut bergabung. Mereka kelak mengungkap bahwa Ordinal Scale bukanlah sebuah permainan semata', 'https://vidoza.net/embed-pi6oswd8x6hu.html?1080p?embed=true&amp;autoplay=true', 'https://vidoza.net/embed-5raedv0ebt3i.html?720p?embed=true&amp;autoplay=true', 'https://vidoza.net/embed-qa1cfdxszv9l.html?embed=true&amp;autoplay=true', 'https://nanifile.nanime.in/file/nanime.sword.art.online.movie.ordinal.scale.sub.indo.1080p.mp4?embed=true&amp;autoplay=true', NULL, 2, NULL, NULL, 'sword-art-online-movie-ordinal-scale-sub-indo'),
(947, 'Sword Art Online Extra Edition Sub Indo', 'movie', 0, 'storage/files/2020/01/26/58b449b679afa9374f417f151517b15f.jpg', 'Yui ingin melihat ikan paus sehingga Kirito menyarankan sebuah pencarian dimana dia dapat bertemu mereka. Namun, ternyata Leafa tidak bisa berenang sehingga Asuna dan karakter wanita lainnya memutuskan untuk melatih Suguha di kolam dunia nyata dalam persiapan untuk pencarian tersebut. Sementara itu, Kirito bertemu seseorang tertentu.', 'https://naniplay.nanime.in/file/nanime.sword.art.online.extra.edition.movie.sub.indo.720p.mp4?embed=true&amp;autoplay=true', 'https://nanifile.com/plugins/mediaplayer/site/_embed.php?u=6h2&w=640&h=320?embed=true&amp;autoplay=true', NULL, NULL, NULL, 2, NULL, NULL, 'sword-art-online-extra-edition-sub-indo'),
