(971, ' Episode 24 Sub Indo', 'episode', 0, 'storage/files/2020/01/26/47b7888548a0996404532108a8fbcb23.jpg', 'Setelah season 1 di tahun 2012 selesai, kemarin yang bertepatan tanggal 5 july 2014 season 2 dari Sword Art Online kembali di tayangkan dengan judul Sword Art Online II. Banyak karakter baru dan permasalahan yang timbul dalam season 2 ini. Season 2 ini diproduksi oleh A1-Pictures dengan mendapatkan 24 episode yang didalamnya terdapat 3 arc, yakni arc Gun gale online (GGO), arc Excalibur dan arc Mother\'s Rosario. Sebelumnya saya pernah mereview season pertama dari anime ini, kamu bisa baca di artikel Review anime Sword Art online \'Terjebak di dunia game mematikan\'. Sword Art online II ini setiap arc-nya memiliki peran utama yang berbeda beda, jadi tidak seperti di season 1 yang hanya menampilkan Kirito dan Asuna saja.', 'https://uservideo.xyz/file/nanime.sword.art.online.s2.e24.sub.indo.720p.mp4?embed=true&amp;autoplay=true', 'https://uservideo.xyz/file/nanime.org.sword.art.online.s2.e24.480p.sub.indo.mp4?embed=true&amp;autoplay=true', 'https://naniplay.nanime.in/file/nanime.sword.art.online.s2.e24.sub.indo.720p.mp4?embed=true&amp;autoplay=true', 'https://naniplay.nanime.in/file/nanime.sword.art.online.s2.e24.sub.indo.480p.mp4?embed=true&amp;autoplay=true', NULL, 3, NULL, NULL, 'episode-24-sub-indo'),
