(1009, ' Episode 24 Sub Indo', 'episode', 24, 'storage/files/2020/01/26/fa4f8629b3f8c887777feaabeb7f6b56.jpg', 'Saat Kirito terbangun, dia berada di kedalaman hutan luas yang dipenuhi dengan pepohonan menjulang tinggi. Ketika dalam pencarian untuk menemukan petunjuk di sekitarnya, Kirito bertemu dengan seorang anak laki-laki yang tampaknya mengenal dirinya. Seharusnya anak itu adalah NPC biasa, akan tetapi ternyata dia mempunyai perasaan layaknya manusia. Saat mereka mencari orang tua dari anak itu, Kirito mulai mengingat kenangan-kenangan yang aneh. Kenangan dimasa kecilnya, tentang anak laki-laki, anak perempuan berambut emas, dan nama yang seharusnya tidak pernah dia lupakan, Alice.Info Kelanjutan-nya silahkan cek Ig  Nanime.in', 'https://uservideo.xyz/file/nanime.sword.art.online.alicization.e24.480p.sub.indo.mp4?embed=true&amp;autoplay=true', 'https://vidoza.net/rkjs9xfiicq1.html?embed=true&amp;autoplay=true', 'https://vidoza.net/hsbffx3dc3l3.html?720p?embed=true&amp;autoplay=true', 'https://vidoza.net/4o9gmqu0n2qz.html?1080p?embed=true&amp;autoplay=true', NULL, 5, NULL, NULL, 'episode-24-sub-indo'),
